(207, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:44:\"Elementor Sites of the Month – August 2020\";s:7:\"excerpt\";s:249:\"Join us as we explore this month’s top websites built with Elementor. This showcase features websites from many countries around the world, such as an Argentinian bakery, a large French Vegan online store, personal wedding websites, and many more.\";s:7:\"created\";i:1600687188;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:120:\"https://elementor.com/blog/showcase-august-2020/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:111:\"How To Maximize Google Analytics Metrics as a Web Designer  — Takeaways From Our Webinar With Andy Crestodina\";s:7:\"excerpt\";s:270:\"As web designers, figuring out how to derive the most value from your metrics can be challenging. In this fascinating webinar, Andy Crestodina helped our audience better understand how to measure and optimize their projects. Here are the main points of his presentation.\";s:7:\"created\";i:1600331223;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/webinar-andy-crestodina/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:35:\"8 Best WordPress Membership Plugins\";s:7:\"excerpt\";s:146:\"To some, membership plugins are the sole source of income. Discover the best WordPress membership plugins, and choose the one that fits you best. \";s:7:\"created\";i:1600077007;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:128:\"https://elementor.com/blog/wordpress-membership-plugins/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:63:\"How to Create a Sticky Sidebar Menu on WordPress With Elementor\";s:7:\"excerpt\";s:184:\"Tired of the standard horizontal menu? In this post, our Elementor expert shows you step-by-step how to create a vertical sidebar navigation menu for an immersive scrolling experience.\";s:7:\"created\";i:1599645352;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:133:\"https://elementor.com/blog/how-to-create-sticky-sidebar-menu/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:48:\"How To Embed Video In WordPress (YouTube + More)\";s:7:\"excerpt\";s:117:\"Learn about all the ways with which you can embed video in WordPress, including videos for private membership sites. \";s:7:\"created\";i:1598963402;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:121:\"https://elementor.com/blog/embed-video-wordpress/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
