rom our strong sense of empathy to serve those in dire need resulting from violent confilict and natural calamity.<\\/p>\\n    <p><span class=\\\"clr_theme_blue\\\">Gender Sensitivity<\\/span>We are robustly cognizant of the discriminations against women and girls and people with special needs; we accord special consideration for these groups with surfacing of benefits, responsibilities and opportunities.<\\/p>\\n    <p><span class=\\\"clr_theme_blue\\\">Sustainable Partnership<\\/span>We are built on the principle of sustainable partnership; this makes it easy for HCEO to implement activities in all the states due to our readily established partnership with existing organizations in these states. We are striving to build similar partnership with donor community and philanthropies\' Who have shared goals and objectives with us.<\\/p>\\n    <p><span class=\\\"clr_theme_blue\\\">Empowerment<\\/span>We belief in Sustainability of all our intervention; Such cannot come to pass without the end user begin part of the solution; we empower people to be the solution to issues affecting them.<\\/p>\\n    <p><span class=\\\"clr_theme_blue\\\">Respect for Children<\\/span>We believe that children and youth are ouur most precious resources. We believe in an approach to community development that builds assets and empowers individuals. We foster leadership, engaging children and the community to give service and make decisions in a democratic society.<\\/p>\\n<\\/div>\"},\"elements\":[],\"widgetType\":\"html\"}],\"isInner\":false},{\"id\":\"35242c2\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":55,\"padding\":{\"unit\":\"px\",\"top\":\"140\",\"right\":\"20\",\"bottom\":\"0\",\"left\":\"130\",\"isLinked\":false},\"padding_tablet\":{\"unit\":\"px\",\"top\":\"110\",\"right\":\"20\",\"bottom\":\"0\",\"left\":\"50\",\"isLinked\":false},\"padding_mobile\":{\"unit\":\"px\",\"top\":\"50\",\"right\":\"20\",\"bottom\":\"0\",\"left\":\"20\",\"isLinked\":false},\"animation\":\"fadeInRight\"},\"elements\":[{\"id\":\"0f03136\",\"elType\":\"widget\",\"settings\":{\"image\":{\"id\":26,\"url\":\"http:\\/\\/localhost\\/wordpress\\/wp-content\\/uploads\\/2020\\/09\\/about-img.jpg\"},\"image_size\":\"full\",\"_z_index\":1,\"_animation\":\"fadeInLeft\",\"_margin\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false}]'),
