(51, 1, '2020-09-24 06:51:14', '2020-09-24 06:51:14', '<style>\n    .vl {<br />\n      border-left: 6px solid green;<br />\n      height: 150px;<br />\n      width:10%;<br />\n    }<br />\n    .top_banner{<br />\n        color: white;<br />\n    }<br />\n</style>\n\n<center>\n<!-- -->\n\nWe belif in Sustainability of all our intervention; such cannot come to pass without the end user begin part of the solution; we empower people to be the solution to issues affection them.\n\n<!-- -->\n</center>\n<img width=\"540\" height=\"622\" src=\"http://localhost/wordpress/wp-content/uploads/2020/09/about-img.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/09/about-img.jpg 540w, http://localhost/wordpress/wp-content/uploads/2020/09/about-img-260x300.jpg 260w\" sizes=\"(max-width: 540px) 100vw, 540px\">\n\"  Nelson Rolihlahla Mandela was a South African anti-aprthid revolutionary. political leader and phlianthropist who served as President of South Africa from 1994 to 1999. He was the country\'s first black head of state and the first elected in a fully representative democratic \"\n<img width=\"540\" height=\"622\" src=\"http://localhost/wordpress/wp-content/uploads/2020/09/about-img.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/09/about-img.jpg 540w, http://localhost/wordpress/wp-content/uploads/2020/09/about-img-260x300.jpg 260w\" sizes=\"(max-width: 540px) 100vw, 540px\">\nNelson Rolihlahla Mandela', 'Activism Lite', '', 'inherit', 'closed', 'closed', '', '33-revision-v1', '', '', '2020-09-24 06:51:14', '2020-09-24 06:51:14', '', 33, 'http://localhost/wordpress/index.php/2020/09/24/33-revision-v1/', 0, 'revision', '', 0),
(52, 1, '2020-09-24 06:52:57', '2020-09-24 06:52:57', '<style>\n    .clr_theme_blue{\n        color: #1658CC;\n        font-size: 20px;\n    }\n    .Our_Core_Values p{\n        padding: 0 0 10px 0;\n    }\n</style>\n    Accountability and Transparency\n    <p>We take responsibility to account to ourselves, our written policies on management of our human, material and financial resources and to account to our beneficiaries, donors and the state with ethics and probity.</p>\n    <p>Volunteerism\n    HCEO embraces the spirit of voluntarism to the peak. We promote and appreciate all our volunteers by empowering them on the positive impact of global voluntary services to the vulnerable children and women and the entire human society.</p>\n    <p>Compassion\n    The humanitarian context of HCEO emerges from our strong sense of empathy to serve those in dire need resulting from violent confilict and natural calamity.</p>\n    <p>Gender SensitivityWe are robustly cognizant of the discriminations against women and girls and people with special needs; we accord special consideration for these groups with surfacing of benefits, responsibilities and opportunities.</p>\n    <p>Sustainable PartnershipWe are built on the principle of sustainable partnership; this makes it easy for HCEO to implement activities in all the states due to our readily established partnership with existing organizations in these states. We are striving to build similar partnership with donor community and philanthropies\' Who have shared goals and objectives with us.</p>\n    <p>EmpowermentWe belief in Sustainability of all our intervention; Such cannot come to pass without the end user begin part of the solution; we empower people to be the solution to issues affecting them.</p>\n    <p>Respect for ChildrenWe believe that children and youth are ouur most precious resources. We believe in an approach to community development that builds assets and empowers individuals. We foster leadership, engaging children and the community to give service and make decisions in a democratic society.</p>\n										<img width=\"540\" height=\"622\" src=\"http://localhost/wordpress/wp-content/uploads/2020/09/about-img.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/09/about-img.jpg 540w, http://localhost/wordpress/wp-content/uploads/2020/09/about-img-260x300.jpg 260w\" sizes=\"(max-width: 540px) 100vw, 540px\" />', 'Our Core Values', '', 'publish', 'closed', 'closed', '', 'our-core-values', '', '', '2020-09-24 08:29:10', '2020-09-24 08:29:10', '', 0, 'http://localhost/wordpress/?page_id=52', 0, 'page', '', 0),
