(56, 1, '2020-09-24 07:29:54', '2020-09-24 07:29:54', 'Accountability and Transparency\n    <p>We take responsibility to account to ourselves, our written policies on management of our human, material and financial resources and to account to our beneficiaries, donors and the state with ethics and probity.</p>\n    <p>Volunteerism\n    HCEO embraces the spirit of voluntarism to the peak. We promote and appreciate all our volunteers by empowering them on the positive impact of global voluntary services to the vulnerable children and women and the entire human society.</p>\n    <p>Compassion\n    The humanitarian context of HCEO emerges from our strong sense of empathy to serve those in dire need resulting from violent confilict and natural calamity.</p>\n    <p>Gender SensitivityWe are robustly cognizant of the discriminations against women and girls and people with special needs; we accord special consideration for these groups with surfacing of benefits, responsibilities and opportunities.</p>\n    <p>Sustainable PartnershipWe are built on the principle of sustainable partnership; this makes it easy for HCEO to implement activities in all the states due to our readily established partnership with existing organizations in these states. We are striving to build similar partnership with donor community and philanthropies\' Who have shared goals and objectives with us.</p>\n    <p>EmpowermentWe belief in Sustainability of all our intervention; Such cannot come to pass without the end user begin part of the solution; we empower people to be the solution to issues affecting them.</p>\n    <p>Respect for ChildrenWe believe that children and youth are ouur most precious resources. We believe in an approach to community development that builds assets and empowers individuals. We foster leadership, engaging children and the community to give service and make decisions in a democratic society.</p>\n										<img src=\"http://localhost/wordpress/wp-content/uploads/2020/09/about-img.jpg\" title=\"about-img.jpg\" alt=\"about-img.jpg\" />', 'Our Core Values', '', 'inherit', 'closed', 'closed', '', '52-revision-v1', '', '', '2020-09-24 07:29:54', '2020-09-24 07:29:54', '', 52, 'http://localhost/wordpress/index.php/2020/09/24/52-revision-v1/', 0, 'revision', '', 0),
